        </span>
      </div>
      <div className="displayData">
        <table border="2px" className="mytable">
          <thead>
            <tr>
              <th>Id</th>
              <th>Name</th>
              <th>Age</th>
              <th>City</th>
              <th>Email-id</th>
            </tr>
          </thead>
        </table>
      </div>
    </>
  );
}

export default UserSearch;
